import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

// Styled Components
const CheckoutContainer = styled.div`
  background-color: #fff;
  display: flex;
  flex-direction: column;
`;

const MainContent = styled.div`
  background-color: #eef2f4;
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: center;
  padding: 21px 0 179px;
`;

const HeaderSection = styled.header`
  position: fixed;
  border-radius: 20px;
  background-color: #f2f2f2;
  display: flex;
  width: 70%;
  overflow: hidden;
  gap: 20px;
  justify-content: space-between;
  padding: 21px 68px;
  box-shadow: 1px 5px 9px 3px rgba(0, 0, 0, 0.147);
  z-index: 1000;
`;

const Logo = styled.img`
  aspect-ratio: 4.13;
  object-fit: contain;
  object-position: center;
  width: 132px;
  max-width: 100%;
`;

const NavButtons = styled.nav`
  display: flex;
  align-items: center;
  gap: 30px;
  color: #000;
  justify-content: start;
  margin: auto 0;
  font: 500 14px Open Sans, sans-serif;
`;

const NavLink = styled(Link)`
  align-self: stretch;
  margin: auto 0;
  cursor: pointer;
  text-decoration: none;
  color: inherit;
`;

const UserActions = styled.div`
  align-self: start;
  display: flex;
  margin-top: 4px;
  align-items: start;
  gap: 30px;
`;

const ActionIcon = styled.img`
  aspect-ratio: 1;
  object-fit: contain;
  object-position: center;
  width: 24px;
`;

const DividerTop = styled.div`
  align-self: stretch;
  min-height: 0px;
  margin-top: 100px;
  width: 99.9%;
  border: 1px solid #d5d5d5;
`;

const Divider = styled.div`
  align-self: stretch;
  min-height: 0px;
  margin-top: 10px;
  width: 99.9%;
  border: 1px solid #d5d5d5;
`;

const BreadcrumbSort = styled.div`
  display: flex;
  width: 100%;
  max-width: 70%;
  gap: 2px;
  flex-wrap: wrap;
  justify-content: space-between;
  margin: 9px 0 0 0px;

  @media (max-width: 991px) {
    width: 70%;
    justify-content: center;
    gap: 2rem;
  }
`;

const Breadcrumb = styled.div`
  align-self: start;
  display: flex;
  gap: 12px;
  color: #000;
  font: 15px Open Sans, sans-serif;
`;

const BreadcrumbItem = styled.span<{ active?: boolean }>`
  align-self: stretch;
  border-radius: 10px;
  background-color: #fff;
  gap: 10px;
  padding: 4px 14px;
  font: ${props => props.active ? '700 15px' : '400 15px'} Open Sans, sans-serif;
`;

const CheckoutContent = styled.main`
  display: flex;
  gap: 20px;
  align-items: start;
  max-width: 70%;
  margin: 38px auto;
  padding: 0 39px;

  @media (max-width: 991px) {
    flex-direction: column;
    padding: 0 20px;
  }
`;

const ContentGrid = styled.div`
  gap: 20px;
  display: flex;

  @media (max-width: 991px) {
    flex-direction: column;
    align-items: stretch;
    gap: 0;
  }
`;

const ShippingColumn = styled.div`
  display: flex;
  flex-direction: column;
  line-height: normal;
  width: 80%;
  margin-left: 0;

  @media (max-width: 991px) {
    width: 100%;
  }
`;

const ShippingDetailsSection = styled.section<{ children: React.ReactNode }>`
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: start;
  color: #000;
  font: 20px Open Sans, sans-serif;
`;

const SectionTitle = styled.h2`
  font-weight: 700;
`;

const AddressCard = styled.div`
  border-radius: 20px;
  background-color: #fff;
  align-self: stretch;
  display: flex;
  margin-top: 18px;
  width: 100%;
  align-items: start;
  gap: 20px;
  font-size: 15px;
  flex-wrap: wrap;
  justify-content: space-between;
  padding: 49px 80px 77px 22px;
  border: 1px solid #e4e4e4;
`;

const AddressInfo = styled.div`
  display: flex;
  margin-top: 5px;
  flex-direction: column;
  align-items: start;
  font-weight: 500;
`;

const InfoItem = styled.p`
  margin-top: 9px;
`;

const EditButton = styled.button`
  display: flex;
  gap: 5px;
  font-weight: 700;
  background: none;
  border: none;
  cursor: pointer;
`;

const EditIcon = styled.img`
  aspect-ratio: 1;
  object-fit: contain;
  object-position: center;
  width: 19px;
  align-self: start;
`;

const MethodCard = styled.div`
  border-radius: 20px;
  background-color: #fff;
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: start;
  color: #000;
  margin: 0 auto;
  padding: 49px 80px 77px 22px;
  font: 700 15px Open Sans, sans-serif;
  border: 1px solid #e4e4e4;
`;

const MethodDescription = styled.p`
  flex-grow: 1;
  flex-basis: auto;
`;

const PaymentColumn = styled.div`
  border-radius: 20px;
  background-color: #fff;
  display: flex;
  width: 100%;
  flex-direction: column;
  align-items: start;
  color: #000;
  margin: 0 auto;
  padding: 49px 80px 77px 22px;
  font: 700 15px Open Sans, sans-serif;
  border: 1px solid #e4e4e4;
`;

const PaymentOption = styled.div`
  display: flex;
  gap: 6px;
`;

const RadioButton = styled.input`
  border-radius: 50%;
  align-self: start;
  display: flex;
  width: 24px;
  height: 24px;
  border: 1px solid #d9d9d9;
`;

const OptionLabel = styled.p`
  flex-basis: auto;
  flex-grow: 1;
`;

const MobileMoneySection = styled.h3`
  margin-top: 45px;
`;

const MobileOption = styled.div`
  display: flex;
  margin-top: 20px;
  gap: 6px;
`;

const CheckoutButton = styled.button`
  align-self: start;
  border-radius: 30px;
  background-color: #0055b6;
  min-height: 57px;
  gap: 10px;
  color: #fff;
  margin: 36px 0 0 0px;
  padding: 19px 150px;
  font: 700 15px Open Sans, sans-serif;
  border: none;
  cursor: pointer;
`;

const OrderSummary = styled.aside`
  flex: 0 0 38%;
`;

const SummarySection = styled.div`
  background: #fff;
  border: 1px solid #e4e4e4;
  border-radius: 10px;
  padding: 30px 22px;
  margin-top: 18%;
`;

const SummaryHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 30px;
`;

const SummaryTitle = styled.h2`
  font: 700 15px 'Open Sans', sans-serif;
  margin: 0;
`;

const ProductList = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;

  @media (max-width: 991px) {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
  }
`;

const ProductItem = styled.li`
  display: flex;
  gap: 15px;
  padding: 20px 11px;
  border-bottom: 1px solid #d5d5d5;
`;

const ProductImage = styled.img`
  width: 89px;
  height: 84px;
  border-radius: 10px;
  object-fit: cover;
